class ScrollBehaviorManager {
    constructor() {
        this.lastScroll = 0;
        this.scrollThreshold = 5;
        this.header = null;
        this.bottomNav = null;
        this.isScrolling = false;
        this.ticking = false; // For requestAnimationFrame throttling
    }

    init() {
        this.header = document.getElementById('mainHeader');
        this.bottomNav = document.getElementById('bottomNav');

        // Cache height values to avoid layout thrashing on scroll
        this.updateCachedHeights();
        window.addEventListener('resize', () => this.updateCachedHeights(), { passive: true });

        if (!this.header) {
            console.warn('âŒ Header element not found - navbar auto-hide disabled');
        }

        if (!this.bottomNav) {
            console.warn('âŒ Bottom nav element not found - bottom nav auto-hide disabled');
        }
        window.addEventListener('scroll', this.onScroll.bind(this), { passive: true });
    }

    updateCachedHeights() {
        this.windowHeight = window.innerHeight;
        this.documentHeight = document.documentElement.scrollHeight;
    }

    onScroll() {
        // Use requestAnimationFrame for smooth, throttled scroll handling
        if (!this.ticking) {
            window.requestAnimationFrame(() => {
                this.handleScroll();
                this.ticking = false;
            });
            this.ticking = true;
        }
    }

    handleScroll() {
        const currentScroll = window.pageYOffset || document.documentElement.scrollTop;

        this.updateNavbarVisibility(currentScroll);

        this.lastScroll = currentScroll;
    }

    updateNavbarVisibility(currentScroll) {
        // NOTE: Header visibility is now handled by nav_fix.js (YouTube-style)
        // This method only handles bottom nav at-bottom detection

        const isAtBottom = (currentScroll + this.windowHeight) >= (this.documentHeight - 50);

        // Always show bottom nav when at bottom of page
        if (isAtBottom) {
            if (this.bottomNav) this.bottomNav.classList.remove('hidden');
        }
    }
}

function initScrollBehavior() {
    const scrollManager = new ScrollBehaviorManager();
    scrollManager.init();
}

