// Visibility-based animation for offer cards
class OfferCardAnimationController {
    constructor() {
        this.offerCards = document.querySelectorAll('.offer-card');
        this.init();
    }

    init() {
        if (!this.offerCards.length) return;

        const observerOptions = {
            root: null,
            rootMargin: '0px 0px -100px 0px',
            threshold: 0.1
        };

        const observer = new IntersectionObserver((entries) => {
            entries.forEach(entry => {
                if (entry.isIntersecting) {
                    entry.target.classList.add('animate');
                } else {
                    entry.target.classList.remove('animate');
                }
            });
        }, observerOptions);

        this.offerCards.forEach(card => observer.observe(card));
    }
}

if (document.readyState === 'loading') {
    document.addEventListener('DOMContentLoaded', () => {
        new OfferCardAnimationController();
    });
} else {
    new OfferCardAnimationController();
}

// ==========================================
// THEME CONTROLLER (SINGLETON)
// ==========================================
class ThemeController {
    constructor() {
        this.html = document.documentElement;
        this.body = document.body;
        this.init();
    }

    init() {
        // Load saved theme
        const savedTheme = localStorage.getItem('theme');
        if (savedTheme === 'dark') {
            this.enableDarkMode();
        } else {
            this.enableLightMode(); // Default
        }

        // Delegate click event to document to handle button even if DOM changes
        document.addEventListener('click', (e) => {
            const toggleBtn = e.target.closest('#themeToggle');
            if (toggleBtn) {
                e.preventDefault();
                this.toggleTheme();
            }
        });

        console.log('âœ… ThemeController Initialized');
    }

    toggleTheme() {
        const currentTheme = this.html.getAttribute('data-theme');
        if (currentTheme === 'light') {
            this.enableDarkMode();
            localStorage.setItem('theme', 'dark');
        } else {
            this.enableLightMode();
            localStorage.setItem('theme', 'light');
        }
    }

    enableLightMode() {
        this.html.setAttribute('data-theme', 'light');
        this.body.classList.add('light-mode');
        // Update meta theme color
        document.querySelector('meta[name="theme-color"]')?.setAttribute('content', '#fef5e7');
    }

    enableDarkMode() {
        this.html.removeAttribute('data-theme');
        this.body.classList.remove('light-mode');
        // Update meta theme color
        document.querySelector('meta[name="theme-color"]')?.setAttribute('content', '#000000');
    }
}

