// ===== GLOBAL SWIPE PROTECTION =====
// Prevents the native browser "White Back Arrow" on edge swipes
function preventGlobalSwipeBack() {
    let touchStartX = 0;
    let touchStartY = 0;

    document.addEventListener('touchstart', (e) => {
        touchStartX = e.changedTouches[0].clientX;
        touchStartY = e.changedTouches[0].clientY;
    }, { passive: true });

    document.addEventListener('touchmove', (e) => {
        const touchEndX = e.changedTouches[0].clientX;
        const touchEndY = e.changedTouches[0].clientY;

        const diffX = touchEndX - touchStartX;
        const diffY = touchEndY - touchStartY;

        // Condition 1: Must be a swipe RIGHT (positive X diff)
        // Condition 2: Must be starting near the LEFT EDGE (0-30px) where back gestures trigger
        // Condition 3: Must be MORE Horizontal than Vertical
        if (touchStartX < 40 && diffX > 5 && Math.abs(diffX) > Math.abs(diffY)) {
            if (e.cancelable) {
                e.preventDefault();
                // console.log('ğŸš« Native Back Swipe Blocked');
            }
        }
    }, { passive: false });

    console.log('ğŸ›¡ï¸ Global swipe protection active');
}

