window.deferredPrompt = null;

document.addEventListener('DOMContentLoaded', () => {
    // 1. Service Worker Registration
    if ('serviceWorker' in navigator) {
        window.addEventListener('load', () => {
            navigator.serviceWorker.register('/service-worker.js')
                .then(registration => {
                    console.log('âœ… ServiceWorker registration successful with scope: ', registration.scope);
                })
                .catch(err => {
                    console.log('âŒ ServiceWorker registration failed: ', err);
                });
        });
    }

    // 2. Install Prompt Logic
    const installBtn = document.getElementById('installBtn');

    // Listen for the 'beforeinstallprompt' event
    window.addEventListener('beforeinstallprompt', (e) => {
        // Prevent Chrome 67 and earlier from automatically showing the prompt
        e.preventDefault();
        // Stash the event so it can be triggered later.
        window.deferredPrompt = e;

        console.log('ğŸ“² PWA Install Prompt captured');

        // Show the install button after 30 seconds
        setTimeout(() => {
            if (installBtn) {
                // Ensure it's visible (remove 'display: none' from style or class)
                installBtn.style.display = 'flex';
                // Add a simple fade-in effect if CSS supports it
                installBtn.style.opacity = '0';
                installBtn.style.transition = 'opacity 0.5s ease';
                requestAnimationFrame(() => {
                    installBtn.style.opacity = '1';
                });

                console.log('ğŸ•’ 30s elapsed: Showing Install Button');
            }
        }, 30000); // 30 seconds
    });

    // 3. Handle Install Button Click
    if (installBtn) {
        installBtn.addEventListener('click', async () => {
            const promptEvent = window.deferredPrompt;
            if (!promptEvent) {
                // The deferred prompt isn't available.
                return;
            }
            // Show the install prompt
            promptEvent.prompt();
            // Log the result
            const result = await promptEvent.userChoice;
            console.log('ğŸ‘ User choice:', result.outcome);

            // Reset the deferred prompt variable, since it can only be used once.
            window.deferredPrompt = null;

            // Hide the install button
            installBtn.style.display = 'none';
        });
    }

    // 4. Handle App Uninstalled
    window.addEventListener('appinstalled', (evt) => {
        console.log('ğŸ‰ App installed successfully');
        if (installBtn) installBtn.style.display = 'none';

    });

    // Initialize Chat Widget
    if (typeof initFloatingChatWidget === 'function') {
        initFloatingChatWidget();
    }
});
